Sono le 5.51...io sono andato via così Maria, che era tanto stanca, riposa un pò... Federico è a dormire da nonno e nonna...e adesso sono solo a letto in un silenzio irreale... poco più di 3 ore  fa sono diventato papà per la seconda volta ...e ora penso ad Alice, che in mezzo ai vagiti suoi un pò dormirà e un pò si strofinerà i pugnetti chiusi mentre starà decifrando le prime luci della vita... lei che è arrivata poi come un abbaglio...io ero là, con la mia spocchia di essere preparato, per esperienza, a questo tipo di emozione e la mia spocchia tutto d'un tratto fa una magra figura e smuore mentre Alice nasce... per niente magra...quasi quattro chili, come il suo fratellino Federico che conoscerà più tardi...è la mia seconda dose massiccia di zucchero filato infilato al cuore e ai polmoni...sono impastati di gioia adesso
Maria è stata bravissima e sta bene, e io la ringrazierò all'infinito, perchè quello che mi ha dato è l'infinito stesso... Alice è la nostra bimba, è nata stanotte per farmi già capire che perderò il sonno per sempre... d'ora in poi sarò sempre uno stanco papà innamorato ❤

@mariafinizioo #benvenutaAlice
